def get_intent(text):
    for intent, intent_data in BOT_CONFIG['intents'].items():
        #print(intent)
        for example in intent_data['examples']:
            edit_distance = nltk.edit_distance(text.lower(), example.lower())
         #   print('\t', example, edit_distance)
            if edit_distance / len(example) < 0.40:
                return intent

def get_response_by_intent(intent):
    phrases = BOT_CONFIG['intents'][intent]['responses']
    return random.choice(phrases)


def get_generative_response(text):
    return


def get_phailure_phrase():
    phrases = BOT_CONFIG['failure_phrases']
    return random.choice(phrases)


get_phailure_phrase()


def go_bot(text):
    # NLU
    intent = get_intent(text)

    # Generate answer

    # rules
    if intent:
        return get_response_by_intent(intent)

    # use generative model
    response = get_generative_response(text)
    if response:
        return response


